import React, { useState } from 'react';
import Booth from './Booth';

export default function VotingCard(args) {
    const [option, count] = useState('args.votes')
    return (
        <div>
            <h3>{args.title}</h3>
            <Booth {...args}/>
        </div>
    );
}
